import Typical from 'react-typical';

import { Footer, Blog, Possibility, Features, WhatGPT3, Header } from './containers';
import { CTA, Brand, Navbar } from './components';

import './App.css';

const App = () => (
  <div className="App">
    <div className="gradient__bg">
      <Navbar />
      <Header />
    </div>
    <h1>Testing Typical</h1>
    <p> 
    </p>
    <Possibility />
    <Brand />
    <WhatGPT3 />
    <Features />
    <CTA />
    <Blog />
    <Footer />
  </div>
);

export default App;
